import React from "react";
import { BrowserRouter as Router, Route} from "react-router-dom";
import Home from "./pages/Home";
import Detailproduit from "./components/Detailproduit";

function App() {
  return (
      <Router>
          <Route path="/details" exact>
            <Detailproduit/>
          </Route>
          <Route path="/" exact>
            <Home />
          </Route>
      </Router>
  );
}

export default App;
